import { useState } from "react";

const Content = () => {
  const [items, setItems]   =  useState([
        {
            id:1,
            checked: false,
            item:"One half pound bag of Cocoa"
        },
        {
            id:2,
            checked: false,
            item:"Salted egg 1 kg."
        },
        {
            id:3,
            checked: false,
            item:"Milk with free cocomelon"
        },
    ]);
    
  return (
    <main>
        <ul>
            {items.map((item)=>(
                <li className="item" key={item.id}><input type="checkbox" checked={item.checked} />{item.item}</li>
            ))}
        </ul>
        
    </main>
  )
}

export default Content
